import React from 'react';
import { GoogleLogin } from '@react-oauth/google';
import { Link } from 'react-router-dom';

const Login = ({ onSuccess, onFailure }) => {
  const renderProps = ({ onClick }) => (
    <button className="list-group-item list-group-item-action custom-login-button"
    onClick={onClick}>
      Sign with Google to Import Contacts
    </button>
  );

  return (
    <div className="list-group">
      <Link to="/contacts" className="list-group-item list-group-item-action ">
        Friends
      </Link>
      <Link to="#" className="list-group-item list-group-item-action">
        Groups
      </Link>
      <GoogleLogin
        render={renderProps}
        buttonText="Sign with Google to Import Contacts"
        onSuccess={onSuccess}
        onFailure={onFailure}
        scope="https://www.googleapis.com/auth/contacts.readonly"
      />
    </div>
  );
};

export default Login;
